def find_parking_spot(L, b, f, requests):
    parking_zones = [[-b, -b, -192], [L + f, L + f, -38]]
    results = []
    for (i, (request_type, value)) in enumerate(requests, start=1):
        if request_type != 1:
            car_length = value
            parked = False
            for w in range(len(parking_zones) - 1):
                if parking_zones[w + 1][0] - parking_zones[w][1] >= b + f + car_length:
                    parking_zones.insert(w + 1, [parking_zones[w][1] + b, parking_zones[w][1] + b + car_length, i])
                    results.append(parking_zones[w][1] + b)
                    parked = True
                    break
            if not parked:
                results.append(-1)
        elif request_type == 2:
            request_number = value
            for t in range(len(parking_zones)):
                if parking_zones[t][2] == request_number:
                    parking_zones.pop(t)
                    break
    return results

